import logo from './logo.svg';
import './App.css';

//importamos los componentes
import Navbar from './components/Navbar';

import CompShowBlogs from './vistas/blog/ShowBlogs';
import CompCreateBlog from './vistas/blog/CreateBlog';
import CompEditBlog from './vistas/blog/EditBlog';

//importamos el router
import { BrowserRouter, Route, Routes } from 'react-router-dom';


function App() {
  return (
    <div className="App">
      <Navbar/>
      <BrowserRouter>
        <Routes>
            <Route path='/blogs' element={ <CompShowBlogs />} />
            <Route path='/blogs/create' element={ <CompCreateBlog />} />
            <Route path='/edit/:id' element={ <CompEditBlog />} />
        </Routes>
      </BrowserRouter>

    </div>
  );
}

export default App;
